function Tahoe() {
  return (
      <div className="Tahoe">
        <img src="https://i.imgur.com/KT4GrIt.png" alt="Workplace" usemap="#icons3"></img>
        <map name="icons3">
          <area shape="rect" coords="48,161,79,193" alt="icon" href="#Reno" pointer="cursor"></area>
          <area shape="rect" coords="53,197,83,231" alt="icon" href="#Carson" pointer="cursor"></area>
        </map>

      </div>
  );
}

export default Tahoe;
